import React from "react";
import styles from "./Products.module.css";
const Products = ({ data }) => {
  return (
    <div className={styles.container}>
      <div className={styles.card}>
        <img src={data.imageUrl} width="80px" alt="" />
        <h4>{data.name}</h4>
      </div>
    </div>
  );
};

export default Products;
